import React from 'react'
import './style.css'
import { Link } from 'react-router-dom'





export default function HomePage(props) {
   
 
    
    const createRoom=()=>{
     props.arrRooms.map((val)=>{
        return <button style={{backgroundColor:val.color}}>{val.name}</button>
     })
        }
    
   

  return (
    <div className='mainDiv'>
    <h2 className='title'>Smart house</h2>
    <Link to={'/addroom'}><button className='btn'>+</button></Link>
    
    {createRoom()}
    </div>
  )
}
